  post: 121,
  follower: 575,
  following: 632
}, {
  cover: "/static/cover/cover-4.png",
  avatar: "/static/avatar/014-man-3.svg",
  name: "Tom Hardy",
  position: "Marketing Manager",
  post: 121,
  follower: 575,
  following: 632
}, {
  cover: "/static/cover/cover-5.png",
  avatar: "/static/avatar/023-man-6.svg",
  name: "Logan Paul",
  position: "Font End Developer",
  post: 121,
